import{_ as a}from"./chunks/v5__01.BTouU_wQ.js";import{_ as e,a as r,b as o,c as l,d as i,e as s}from"./chunks/v5__quickstart_07.CYrbg7Mz.js";import{_ as n,c as d,a8 as c,o as h}from"./chunks/framework.BDnHobkS.js";const k=JSON.parse('{"title":"Короткий посібник з підключення CUAV V5+","description":"","frontmatter":{},"headers":[],"relativePath":"uk/assembly/quick_start_cuav_v5_plus.md","filePath":"uk/assembly/quick_start_cuav_v5_plus.md"}'),p={name:"uk/assembly/quick_start_cuav_v5_plus.md"};function u(m,t,f,g,b,_){return h(),d("div",null,t[0]||(t[0]=[c('<h1 id="короткии-посібник-з-підключення-cuav-v5" tabindex="-1">Короткий посібник з підключення CUAV V5+ <a class="header-anchor" href="#короткии-посібник-з-підключення-cuav-v5" aria-label="Permalink to &quot;Короткий посібник з підключення CUAV V5+&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>PX4 не розробляє цей (або будь-який інший) автопілот. Contact the <a href="https://store.cuav.net/" target="_blank" rel="noreferrer">manufacturer</a> for hardware support or compliance issues.</p></div><p>This quick start guide shows how to power the <a href="./../flight_controller/cuav_v5_plus.html">CUAV V5+</a> flight controller and connect its most important peripherals.</p><p><img src="'+a+'" alt="V5+ AutoPilot - Hero Image"></p><h2 id="огляд-схеми-підключення" tabindex="-1">Огляд схеми підключення <a class="header-anchor" href="#огляд-схеми-підключення" aria-label="Permalink to &quot;Огляд схеми підключення&quot;">​</a></h2><p>На зображенні нижче показано, як під&#39;єднати найважливіші датчики та периферійні пристрої (за винятком виходів мотора та сервоприводів). Ми розглянемо кожну з них докладно в наступних розділах.</p><p><img src="'+e+'" alt="V5+ AutoPilot"></p><table tabindex="0"><thead><tr><th style="text-align:left;">Основний інтерфейс</th><th style="text-align:left;">Функція</th></tr></thead><tbody><tr><td style="text-align:left;">Power1</td><td style="text-align:left;">Підключає модуль живлення. Power input with <em>analog</em> voltage and current detection. Не використовуйте Digital PM на цьому роз&#39;ємі!</td></tr><tr><td style="text-align:left;">Power2</td><td style="text-align:left;">Підключає i2c розумну батарею.</td></tr><tr><td style="text-align:left;">TF CARD</td><td style="text-align:left;">Карта SD для зберігання журналів (карта попередньо вставлена на заводі).</td></tr><tr><td style="text-align:left;">M1~M8</td><td style="text-align:left;">PWM виходи. Може бути використаний для управління двигунами або сервоприводами.</td></tr><tr><td style="text-align:left;">A1~A6</td><td style="text-align:left;">PWM виходи. Може бути використаний для управління двигунами або сервоприводами.</td></tr><tr><td style="text-align:left;">DSU7</td><td style="text-align:left;">Використовується для дебагінгу FMU, читання інформації щодо дебагінгу.</td></tr><tr><td style="text-align:left;">І2C1/I2C2</td><td style="text-align:left;">Підключає пристрій I2C, такий як зовнішній компас.</td></tr><tr><td style="text-align:left;">CAN1/CAN2</td><td style="text-align:left;">Підключає пристрої UAVCAN, такі як CAN GPS.</td></tr><tr><td style="text-align:left;">TYPE-C(USB)</td><td style="text-align:left;">Під&#39;єднати до комп&#39;ютера для зв&#39;язку між контролером польоту та комп&#39;ютером, наприклад, як завантаження прошивки.</td></tr><tr><td style="text-align:left;">SBUS OUT</td><td style="text-align:left;">Підключає пристрої SBUS (наприклад, камери з карданним підвісом).</td></tr><tr><td style="text-align:left;">GPS&amp;SAFETY</td><td style="text-align:left;">Приєднайтесь до Neo GPS, який містить GPS, перемикач безпеки, інтерфейс зумовлювача.</td></tr><tr><td style="text-align:left;">TELEM1/TELEM2</td><td style="text-align:left;">Під&#39;єднатися до системи телеметрії.</td></tr><tr><td style="text-align:left;">DSM/SBUS/RSSI</td><td style="text-align:left;">Включає інтерфейси введення сигналів DSM, SBUS, RSSI, інтерфейс DSM може бути підключений до приймача DSM-супутника, інтерфейс SBUS - до приймача дистанційного керування SBUS, RSSI - для модуля зворотного повернення сили сигналу.</td></tr></tbody></table><div class="info custom-block"><p class="custom-block-title">INFO</p><p>For more interface information, please read <a href="http://manual.cuav.net/V5-Plus.pdf" target="_blank" rel="noreferrer">V5+ Manual</a>.</p></div><p><img src="'+r+'" alt="V5+ AutoPilot"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>If the controller cannot be mounted in the recommended/default orientation (e.g. due to space constraints) you will need to configure the autopilot software with the orientation that you actually used: <a href="./../gps_compass/rtk_gps.html">Flight Controller Orientation</a>.</p></div><h2 id="gps-компас-безпечнии-вимикач-світлодіоди" tabindex="-1">GPS + Компас + Безпечний вимикач + Світлодіоди <a class="header-anchor" href="#gps-компас-безпечнии-вимикач-світлодіоди" aria-label="Permalink to &quot;GPS + Компас + Безпечний вимикач + Світлодіоди&quot;">​</a></h2><p>The recommended GPS module is the <em>Neo v2 GPS</em>, which contains GPS, compass, safety switch, buzzer, LED status light.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Other GPS modules may not work (see <a href="./../flight_controller/cuav_v5_nano.html#compatibility_gps">this compatibility issue</a>)).</p></div><p>The GPS/Compass module should be <a href="./../assembly/mount_gps_compass.html">mounted on the frame</a> as far away from other electronics as possible, with the direction marker towards the front of the vehicle (<em>Neo v2 GPS</em> arrow is in the same direction as the flight control arrow). Під&#39;єднайтеся до інтерфейсу GPS контролера польоту за допомогою кабелю.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>If you use the <a href="http://doc.cuav.net/gps/neo-series-gnss/en/neo-v2-pro.html" target="_blank" rel="noreferrer">NEO V2 PRO GNSS (CAN GPS)</a>, please use the cable to connect to the flight control CAN interface.</p></div><p><img src="'+o+'" alt="V5+ AutoPilot"></p><h2 id="запобіжнии-перемикач" tabindex="-1">Запобіжний перемикач <a class="header-anchor" href="#запобіжнии-перемикач" aria-label="Permalink to &quot;Запобіжний перемикач&quot;">​</a></h2><p>The dedicated safety switch that comes with the V5+ is only required if you are not using the recommended <em>Neo V2 GPS</em> (which has an inbuilt safety switch).</p><p>If you are flying without the GPS you must attach the switch directly to the <code>GPS1</code> port in order to be able to arm the vehicle and fly (if you use the old 6-pin GPS, please read the definition of the bottom interface to change the line).</p><h2 id="зумер" tabindex="-1">Зумер <a class="header-anchor" href="#зумер" aria-label="Permalink to &quot;Зумер&quot;">​</a></h2><p>Якщо ви не використовуєте рекомендований GPS, зумер може не працювати.</p><h2 id="радіоуправління" tabindex="-1">Радіоуправління <a class="header-anchor" href="#радіоуправління" aria-label="Permalink to &quot;Радіоуправління&quot;">​</a></h2><p>Для ручного керування вашим апаратом потрібна система дистанційного керування радіо (RC) (PX4 не вимагає наявності системи радіо для автономних режимів польоту). Вам буде потрібно вибрати сумісний передавач/приймач та потім зв&#39;язати їх, щоб вони взаємодіяли (прочитайте інструкції, що додаються до вашого конкретного передавача/приймача).</p><p>На малюнку нижче показано, як ви можете отримати доступ до вашого віддаленого приймача (знайдіть кабель SBUS у комплекті).</p><p><img src="'+l+'" alt="V5+ AutoPilot"></p><h2 id="супутникові-приимачі-spektrum" tabindex="-1">Супутникові приймачі Spektrum <a class="header-anchor" href="#супутникові-приимачі-spektrum" aria-label="Permalink to &quot;Супутникові приймачі Spektrum&quot;">​</a></h2><p>V5+ має присвячений кабель DSM. Якщо використовується супутниковий приймач Spektrum, його слід підключити до інтерфейсу DSM/SBUS/RSSI контролера польоту.</p><h2 id="power" tabindex="-1">Power <a class="header-anchor" href="#power" aria-label="Permalink to &quot;Power&quot;">​</a></h2><p>The V5+ kit includes the <em>HV_PM</em> module, which supports 2~14S LiPo batteries. Connect the 6pin connector of the <em>HW_PM</em> module to the flight control <code>Power1</code> interface.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>The supplied power module is unfused. Power <strong>must</strong> be turned off while connecting peripherals.</p></div><p><img src="'+e+'" alt="V5+ AutoPilot"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The power module is not a power source for peripherals connected to the PWM outputs. Якщо ви підключаєте сервоприводи / приводи, вам потрібно окремо живити їх за допомогою BEC.</p></div><h2 id="система-телеметріі-опціонально" tabindex="-1">Система телеметрії (Опціонально) <a class="header-anchor" href="#система-телеметріі-опціонально" aria-label="Permalink to &quot;Система телеметрії (Опціонально)&quot;">​</a></h2><p>Система телеметрії дозволяє вам спілкуватися, контролювати та управляти транспортним засобом у польоті з наземної станції (наприклад, ви можете направляти БПЛА до певної позиції або завантажувати нове завдання).</p><p>Канал зв&#39;язку здійснюється через телеметричні радіостанції. The vehicle-based radio should be connected to either the <code>TELEM1</code> or <code>TELEM2</code> port (if connected to these ports, no further configuration is required). Інша радіостанція підключається до вашого комп&#39;ютера або мобільного пристрою наземної станції (зазвичай через USB).</p><p><img src="'+i+'" alt="V5+ AutoPilot"></p><p><a id="sd_card"></a></p><h2 id="sd-карта-опціонально" tabindex="-1">SD-карта (Опціонально) <a class="header-anchor" href="#sd-карта-опціонально" aria-label="Permalink to &quot;SD-карта (Опціонально)&quot;">​</a></h2><p>An <a href="./../getting_started/px4_basic_concepts.html#sd-cards-removable-memory">SD card</a> is inserted in the factory (you do not need to do anything).</p><h2 id="двигуни" tabindex="-1">Двигуни <a class="header-anchor" href="#двигуни" aria-label="Permalink to &quot;Двигуни&quot;">​</a></h2><p>Motors/servos are connected to the MAIN and AUX ports in the order specified for your vehicle in the <a href="./../airframes/airframe_reference.html">Airframes Reference</a>.</p><p><img src="'+s+'" alt="V5+ AutoPilot"></p><h2 id="схема-розташування-виводів" tabindex="-1">Схема розташування виводів <a class="header-anchor" href="#схема-розташування-виводів" aria-label="Permalink to &quot;Схема розташування виводів&quot;">​</a></h2><p>Download <strong>V5+</strong> pinouts from <a href="http://manual.cuav.net/V5-Plus.pdf" target="_blank" rel="noreferrer">here</a>.</p><h2 id="подальша-інформація" tabindex="-1">Подальша інформація <a class="header-anchor" href="#подальша-інформація" aria-label="Permalink to &quot;Подальша інформація&quot;">​</a></h2><ul><li><a href="./../frames_multicopter/dji_f450_cuav_5plus.html">Airframe build-log using CUAV v5+ on a DJI FlameWheel450</a></li><li><a href="http://manual.cuav.net/V5-Plus.pdf" target="_blank" rel="noreferrer">CUAV V5+ Manual</a> (CUAV)</li><li><a href="http://doc.cuav.net/flight-controller/v5-autopilot/en/v5+.html" target="_blank" rel="noreferrer">CUAV V5+ docs</a> (CUAV)</li><li><a href="https://docs.google.com/spreadsheets/d/1-n0__BYDedQrc_2NHqBenG1DNepAgnHpSGglke-QQwY/edit#gid=912976165" target="_blank" rel="noreferrer">FMUv5 reference design pinout</a> (CUAV)</li><li><a href="https://github.com/cuav" target="_blank" rel="noreferrer">CUAV Github</a> (CUAV)</li><li><a href="https://github.com/cuav/hardware/tree/master/V5_Autopilot/V5%2B/V5%2BBASE" target="_blank" rel="noreferrer">Base board design reference</a> (CUAV)</li></ul>',47)]))}const v=n(p,[["render",u]]);export{k as __pageData,v as default};
